import { useEffect } from "react"

function Card(props) {
    
    function getNoticias() {
        axios.get("http://localhost:8000/news")
        .then(response => props.setNews(response.data))
        .catch(error => console.log(error))
    }

    useEffect(() =>{
        getNoticias()
    }, [])

    const newNews = props.news.map((item) =>{
        return(
            <div>
                <h2>{item.titulo}</h2>
                
            </div>
        )
    })

    return(
    <>
    Card
    </>
    )
}

export default Card
